import React, { useEffect, useState } from 'react'
import Axios from 'axios';

function UpcomingEvents({search}) {
    const [verifiedList, setVerifiedList] = useState([]);
    var tempList = [];

    useEffect(() => {
        Axios.get('http://localhost:3001/getVerifiedEvents')
            .then((res) => {
                setVerifiedList(res.data);
            })
            .catch((err) => {
                alert(err);
            })
        const tempList = verifiedList;
    }, [setVerifiedList]);

    function handleClick(){
        setVerifiedList((old) => old.filter((ele) => ele.ename.startsWith(search)));
    }

    return (
        <div>

            <button onClick={handleClick}>search</button>
            <h2>UpcomingEvents</h2>
            <div>
                {
                    verifiedList.map((ele) => {
                        return (
                            <div key={ele.eventid}>
                                <h4>{ele.ename}</h4>
                                <div>{ele.desc}</div>
                                <div>{ele.edate}</div>
                                <a href={`${ele.reglink}`}>Click here to register</a>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    )
}

export default UpcomingEvents
